import React, { useState } from 'react';
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  min-height: 100vh;
  padding: 20px;
  background-color: #D3E8F7;
  box-sizing: border-box;
`;

const Title = styled.div`
  font-size: 25px;
  font-family: "Pretendard-ExtraBold";
  color: #252A2F;
`;

const ButtonContainer = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  gap: 10%;
  margin-top: 5%;
`;

const Button = styled.button`
  background-color: white;
  color: #252A2F;
  border: none;
  border-radius: 10px;
  width: 30%;
  height: 50px;
  font-size: 16px;
 font-family: "Pretendard-ExtraBold";
`;

const TasteSurvey = () => {

  return (
    <Container>
      <Title>어떤 여행을 주로 다니셨나요?</Title>
      <ButtonContainer>
        <Button>단거리</Button>
        <Button>원거리</Button>
      </ButtonContainer>
      <ButtonContainer>
        <Button>휴식</Button>
        <Button>활동형</Button>
      </ButtonContainer>
      <ButtonContainer>
        <Button>자연</Button>
        <Button>도심</Button>
      </ButtonContainer>
    </Container>
  );
};

export default TasteSurvey;
